var angleToCharMap = new Dictionary<double, char>();\n\n// Add initial data\nangleToCharMap.Add(0.0, 'a');\n\n// Function to add or retrieve data\nchar GetCharForAngle(double angle)\n{\n    if (!angleToCharMap.TryGetValue(angle, out char character))\n    {\n        // Angle not found, add a new character\n        character = (char)('a' + angleToCharMap.Count);\n        angleToCharMap.Add(angle, character);\n    }\n    return character;\n}\n\n// Example usage:\nConsole.WriteLine(GetCharForAngle(0.0)); // Output: a\nConsole.WriteLine(GetCharForAngle(1.0)); // Output: b (new character added)\nConsole.WriteLine(GetCharForAngle(0.0)); // Output: a (existing character retrieved)